import React from 'react'
import Sprite from "./Sprite";
import { Loop, Stage, World, Body } from 'react-game-kit';

function App() {
    return (
        <Loop>
            <Stage>
                <World>
                    <Sprite
                        repeat={true}
                        src="assets/player.png"
                        scale={this.context.scale * 2}
                        state={0}
                        steps={[9, 9, 0, 4, 5]}
                    />
                </World>
            </Stage>
        </Loop>
    )
}

export default App
